#【csv文件处理】院校属性整理（985，211，双一流，c9）
import os
from pathlib import Path
folder_path=rf"{basepath}\院校属性"
alldf=pd.DataFrame({})
# 遍历文件夹中的所有PNG文件
for file_name in os.listdir(folder_path):
    if file_name.endswith(".csv"):
        file_path=os.path.join(folder_path, file_name)
        thisdf=pd.read_csv(fr"{file_path}")
        thisname=file_name.replace(".csv","")
        if (file_name.startswith("c9"))or(file_name.startswith("双一流院校")):
            print("file_name",file_name)
            thisdf=thisdf.rename(columns={thisname:"名称"})
            thisdf=thisdf[["名称"]]
            thisdf[thisname]="True"
            if len(alldf)==0:
                alldf=thisdf
            else:
                print("thisdf",thisdf)
                alldf=pd.merge(left=alldf,right=thisdf,on="名称",how="outer")#进行外连接合并，外连接会保留所有匹配和不匹配的行，不匹配的行将在另一DataFrame没有的列上填充NaN。
        else:
            thisdf=thisdf[["名称","所在地"]]
            thisdf[thisname]="True"
            if len(alldf)==0:
                alldf=thisdf
            else:
                print("thisdf",thisdf)
                alldf=pd.merge(left=alldf,right=thisdf,on=["名称","所在地"],how="outer")#进行外连接合并，外连接会保留所有匹配和不匹配的行，不匹配的行将在另一DataFrame没有的列上填充NaN。
        alldf.reset_index(drop=False)
        print(alldf)
alldf.to_csv("院校属性.csv")



